import React, { useState } from 'react'
import NavBar from './Components/NavBar';

function App() {

  const [userLoggeIn, setUserLoggedIn] = useState(false)

  const handleAuth = () => {

      setUserLoggedIn(!userLoggeIn)
  }

  return (
    <div>
      <h1>User Auth</h1>
      <NavBar userLoggeIn={userLoggeIn} handleAuth={handleAuth}/>
    </div>
  )
}

export default App;
